import React, { Component } from 'react';
import '../Content.css'
import { Tooltip } from 'reactstrap';
import K from './Map/3.png' //กะทู้
import T from './Map/4.png' //ถลาง
import M from './Map/2.png' //เมือง

class Chart extends Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            tooltipOpen: false
        };
    }

    toggle() {
        this.setState({
            tooltipOpen: !this.state.tooltipOpen
        });
    }

    render() {
        return (
            <div className="Map">
                <div class="container-fluid" >
                    <div class="row" >
                        <div class="col-lg-4" >
                            <span id="TooltipExample"><img src={K} width="55%" /></span>
                            <Tooltip placement="right" isOpen={this.state.tooltipOpen} target="TooltipExample" toggle={this.toggle} >
                                อำเภอ กะทู้
                            </Tooltip>
                            
                        </div>

                        <div class="col-lg-4" >
                        <span id="TooltipExample"><img src={T} width="100%" /></span>
                            <Tooltip placement="right" isOpen={this.state.tooltipOpen} target="TooltipExample" toggle={this.toggle} >
                                อำเภอ กะทู้
                            </Tooltip>
                        </div>

                        <div class="col-lg-4" >
                        <span id="TooltipExample"><img src={M} width="50%" /></span>
                            <Tooltip placement="right" isOpen={this.state.tooltipOpen} target="TooltipExample" toggle={this.toggle} >
                                อำเภอ กะทู้
                            </Tooltip>
                        </div>

                    </div>
                </div>
            </div>
        )
    }
}
export default Chart
